import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1, //makes it occupy the whole space left
    backgroundColor: '#F0F0F7',
  },

  teacherList: {
    marginTop: -40,
  },

  searchForm: {
    marginBottom: 24
  },

  label: {
    color: '#D4C2FF',
    fontFamily: 'Poppins_400Regular'
  },

  input: {
    height: 54,
    backgroundColor: '#FFF',
    borderRadius: 8,

  }

});

export default styles;
